import 'package:flame/components.dart';

/// Country shape data with multi-polygon support.
/// Derived from Natural Earth 10m (Public Domain).
/// High-resolution borders for pristine rendering.
class CountryShape {
  const CountryShape({
    required this.code,
    required this.name,
    required this.polygons,
    this.capital,
  });

  final String code;
  final String name;
  final List<List<Vector2>>
  polygons; // Each polygon is a list of [lng, lat] pairs
  final String? capital;

  /// Flat list of all points across all polygons (for hit-testing, bounding box, etc.)
  List<Vector2> get allPoints => polygons.expand((p) => p).toList();
}

/// City data for low-altitude view.
class CityData {
  const CityData({
    required this.name,
    required this.countryCode,
    required this.location,
    this.isCapital = false,
    this.difficulty = 'easy',
  });

  final String name;
  final String countryCode;
  final Vector2 location; // [lng, lat]
  final bool isCapital;
  final String difficulty; // 'easy', 'medium', 'hard'
}

